import { Typography, Divider, Container, Box } from "@material-ui/core";
import { positions } from "@material-ui/system";

export const MyFooter = () => {
  return (
    <Box position="bottom">
      <Divider />
      <Typography variant="caption" align="right">
        Created by Raphael
      </Typography>
    </Box>
  );
};
